import React from "react";

class Player extends React.Component {
  render() {
    return (
      <form>
        <label>
          Player X
          <input type="radio" name="player" value="X" />
        </label>
        <label>
          Player O
          <input type="radio" name="player" value="O" />
        </label>
        <input type="submit" value="start"/>
      </form>
    );
  }
}

export default Player;
